import Home from './Home'
import React from 'react'
import '../botones.css';
import { Link } from 'react-router-dom';
import calendario from '../calendario.jpg'

function Pages() {
  return (
    <div className="page-container">
    <div className="container">
      <Home />
    </div>
    <div className="button-container">
      <Link to="/sesion" className="person-button">
        Iniciar Sesión
      </Link>
    </div>
    <div className="calendario-button"> {/* Agrega una nueva clase para el botón de calendario */}
      <Link to="/calendar" className="boton-calendario"> {/* Utiliza Link para redirigir */}
        <img src="ruta-de-la-imagen/calendario.png" alt="Calendario" />
      </Link>
    </div>
  </div>
  );
}

export default Pages
